import React from 'react';
import useForm from "react-hook-form";
import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import Icon from '@material-ui/core/Icon';


const useStyles = makeStyles(theme => ({
  container: {
    display: 'flex',
    flexWrap: 'wrap',
    margin: 'auto'
  },
  textField: {
    marginLeft: theme.spacing(1),
    marginRight: theme.spacing(1),
    width: 200,
  },
  button: {
    margin: theme.spacing(1),
  },
  rightIcon: {
    marginLeft: theme.spacing(1),
  }
}));


export default function TextFieldMargins() {
  const {register, handleSubmit, errors} = useForm();
  const onSubmit = data => {console.log(data)}
  const classes = useStyles();

  return (
    <div className={classes.container}>
      <TextField ref={register} 
        variant="outlined"
        label="Name"
        id="Name_field"
        placeholder="Please enter your name"
        className={classes.textField}
        helperText="Help us get to know you!"
        margin="normal"
      />
      <TextField ref={register}
        variant="outlined"
        label="Email"
        id="Email_field"
        placeholder="Valid Email"
        className={classes.textField}
        helperText="How can we reach you?"
        margin="normal"
      />
      <TextField ref={register}
        variant="outlined"
        label="Message"
        id="Message_field"
        placeholder="Message"
        className={classes.textField}
        helperText="What can we help you with?"
        margin="normal"
      />
      <Button onClick={handleSubmit(onSubmit)} variant="contained" color="primary" className={classes.button}>
        Send
        <Icon className={classes.rightIcon}>send</Icon>
      </Button>
    </div>
    
  );
}
